import gql from 'graphql-tag'

export const POST_LIST_QUERY = gql`
    query allPosts {
        allPosts {
            title
            content
            userId
            id
        }
    }
`

export const POST_QUERY = gql`
    query post($id:Int!)  {
        post (id: $id) {
            title
            content
        }
    }
`
